import React, { Component } from "react";

const Like = () => {
  let classes = "fa fa-heart";
  if (!this.props.liked) classes += "-o";
  return (
    <i
      className={classes}
      aria-hidden="true"
      onClick={this.props.onClick}
      style={{ cursor: "pointer" }}
    ></i>
  );
};

export default Like;
